    "import matplotlib.pyplot as plt\n",
    "from sklearn.metrics import roc_curve\n",
    "#ROC曲线绘制\n",
    "fpr, tpr, thresholds = roc_curve(y_test, clf.predict_proba(X_test)[:, 1])\n",
    "\n",
    "plt.plot(fpr, tpr, label='ROC Curve')\n",
